import React, { Component } from 'react';
import { slide as Menu } from 'react-burger-menu';

class BurgerIcon extends Component {
    showSettings(event) {
      event.preventDefault();
    }

    render() {
        return(
            <div className="burger">
                <Menu styles={styles} right={true} customBurgerIcon={ <i className="big code icon"></i> }>
                    <a id="home" className="menu-item" href="#home">Home</a>
                    <a id="about" className="menu-item" href="#aboutme">About</a>
                    <a id="projectwork" className="menu-item" href="#mywork">What I've Built</a>
                    <a id="contact" className="menu-item" href="#contactme">Contact</a>
                </Menu>
            </div>
        )
    }
};

var styles = {
  bmBurgerButton: {
    position: 'absolute',
    width: '26px',
    height: '20px',
    right: '35px',
    top: '35px'
  },
  bmBurgerBars: {
    background: '#373a47'
  },
  bmBurgerBarsHover: {
    background: '#a90000'
  },
  bmCrossButton: {
    height: '24px',
    width: '24px'
  },
  bmCross: {
    background: '#bdc3c7'
  },
  bmMenuWrap: {
    position: 'fixed',
    height: '100%'
  },
  bmMenu: {
    background: 'orange',
    padding: '2.5em 1.5em 0',
    fontSize: '1.15em'
  },
  bmMorphShape: {
    fill: '#373a47'
  },
  bmItemList: {
    color: 'rgba(255, 255, 255, 0.87)',
    padding: '0.8em'
  },
  bmItem: {
    display: 'inline-block'
  },
  bmOverlay: {
    background: 'rgba(0, 0, 0, 0.3)'
  }
}

export default BurgerIcon;
